import { useState } from "react";
import { Dialog, DialogTitle, Tab, Tabs, TabContext, TabPanel } from "@mui/material";
import { useForm } from "react-hook-form";
import { LoginApi, RegisterApi } from "./api-tasks";
import Login from "./login";
import Register from "./register";

const LoginReg = () => {
  const [value, setValue] = useState(0);
  const [open, setOpen] = useState(false);
  const { register, handleSubmit } = useForm();

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const LoginR = (data) => {
    console.log(data);
    LoginApi(data);
  };

  const RegisterR = (data) => {
    RegisterApi(data.text);
  };

  const handleOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
    <button onClick={handleOpen}>Open Dialog</button>
    <Dialog open={open} onClose={handleClose} >
      <DialogTitle>{value === 0 ? "Login" : "Register"}</DialogTitle>
      <Tabs
        value={value}
        onChange={handleChange}
        aria-label="wrapped label tabs example"
      >
        <Tab className="" label="Login" />
        <Tab label="Register" />
      </Tabs>
      {value === 0 ? (
        <Login handleSubmit={handleSubmit} register={register} LoginR={LoginR} />
      ) : (
        <Register handleSubmit={handleSubmit} register={register} RegisterR={RegisterR} />
      )}
    </Dialog>
  </div>
  );
};

export default LoginReg;
